post_text:
We are working on our “Return To School” plan with a goal to release to the parents and community by July 24. The plan will be based on the ISBE Guidelines with staff & student safety, emotional development, and instruction as our priorities.

*Require use of appropriate personal protective equipment (PPE), including face coverings;
*Prohibit more than 50 individuals from gathering in one space;
*Require social distancing be observed, as much as possible;
*Require that schools conduct symptom screenings and temperature checks or require that individuals self-certify that they are free of symptoms before entering school buildings; and
*Require an increase in schoolwide cleaning and disinfection.

Your continued support of our schools is greatly appreciated. IT’S A GREAT DAY TO BE A BULLET AND A BEE BEE! https://t.co/x5JclOY4Mz

